      <h1>Welcome to  Page</h1>
    </div>
  );



}

function Home(){
console.log("username:",username,"\n auth:",auth);

//console.log("username:",location.state.username,"\n auth:",location.state.auth);
const location=useLocation();
console.log()
if(auth){
return(
    <div className="App">
      <header className="App-header">
        <NavBar username={username} auth={auth}/>
        <p>
        <div>
          <h1>Welcome {username}</h1>
        </div>

        </p>       
        <p>
          <Effect username={username} auth={auth}/>
        </p>
      </header>
