return(
    <div className="App">
      <header className="App-header">
        <NavBar username={username} auth={location.state.auth}/>
        <p>
        <div>
          <h1>Welcome {username}</h1>
        </div>

        </p>       
        <p>
          <Effect username={username} auth={location.state.auth}/>
